How to query nested mongo collection<p>I have a collection called 'Profiles', and it has a structure like this:</p>

<pre><code>{
_id : XXXXX,
classrooms:{
   owner:[],
   students: [XYSk0,CCD7U],
},
...
}
</code></pre>

<p>I want to get profiles that has <code>classrooms.students</code> equals to <code>CCD7U</code>.</p>

<p>I have tried using <code>$elemMatch</code> on the collection publish function, but unsuccessful:</p>

<pre><code>Meteor.publish('StudentsInClassrooms', function(CCD7U){
   return Profiles.find({ classrooms : { $elemMatch :{ students : CCD7U }} });
});
</code></pre>

<p>I even tried dot notation, but still unsuccessful:</p>

<pre><code>Meteor.publish('StudentsInClassrooms', function(CCD7U){
   return Profiles.find({ 'classrooms.students' : CCD7U });
});
</code></pre>

<p>How to properly query that kind of nested collection?</p>

