      delivered: { $sum: 1 }
    }
  }
])
  .sort('_id')
  .then(response =&gt; {
    if (response) {
      res.json(response);
    }
  });
 });
</code></pre>

<p>Here is a truncated version of the schema:</p>

<pre><code>const Wip =  new Schema({
      branch: {
        type: Schema.Types.ObjectId,
